DESCRIPTION:
Labai gilios duobės:
1. Prie Lazdynų ligoninės, įvažiavimas į skubios pagalbos skyrių, netoli buvusio &#34;kontrolės posto&#34; namelio (raudonų plytų), gylis apie 20 cm, gal ir daugiau;
2. Prie Jeruzalės g. 17 IKI parduotuvės, ant įvažiavimo į parkavimo aikštelę (pirmas įvažiavimas nuo veterinarijos klinikos pusės), gylis apie 20 cm.
